/// brief_A : "&lt;div style=&quot;text-align:justify&quot;&gt;\r\n&lt;p&gt;&amp;ldquo;The government has been honored to submit its program of action to the House of Representatives in July 2018. The government has continued to persistently implement this program with all its axes, which were included in the government&amp;#39;s presidential assignment letter issued in June 2018. Despite the Corona virus outbreak and its extended impact on various countries of the world and on numerous Egyptian plans, the Egyptian government has been keen to quickly and effectively contain it and support the groups and sectors most affected by the repercussions of the pandemic.&lt;/p&gt;\r\n\r\n&lt;p&gt;It is worth noting that the adopted, and well-planned governmental policies, especially the economic reform program applied since late 2016, have contributed to achieving a real and effective way to overcome Egypt&amp;#39;s effects and repercussions of the crisis with the least possible losses. This has been evident in increasing financial capacity in light of the good performance of the State&amp;#39;s General Budget, and maintaining a positive growth rate along with few countries in the world.&lt;/p&gt;\r\n\r\n&lt;p&gt;Through its program of action, the government has been keen on giving the health sector great attention and arduous efforts; and to create a clear vision for the development and strengthening of this vital sector, which has reflected positively on the cohesion of the Egyptian health system in the face of the crisis. The government has been providing various vaccines to overcome this crisis with the inevitability of local manufacturing to secure a large stock of these vaccines for citizens in the light of the limited global production, in a way that paves the way to achieving self-sufficiency and to export accordingly.&lt;/p&gt;\r\n\r\n&lt;p&gt;Complementing the successfully implemented economic program, the government has launched in April 2021 the National Program for Structural Reforms without placing any new burdens on the Egyptian citizen, with the aim of transforming the Egyptian economy into a productive one with competitive advantages while improving the business environment, enhancing the role of the private sector, and raising the efficiency of public institutions. This can be achieved by adopting digital transformation and governance policies to achieve balanced and sustainable growth in the coming years in cooperation with all actors. It&amp;rsquo;s worth mentioning that many international institutions have praised the good indicators achieved by the Egyptian economic reform program.&lt;/p&gt;\r\n\r\n&lt;p&gt;Considering the commitment of the government to inform the Egyptian people and their deputies of the progress achieved in its work program, I am honored to put before you the comprehensive follow-up report of the government&amp;#39;s work program during the past three years (July 2018- June 2021), including the most prominent efforts of the government in confronting the Corona virus, hoping that Egypt and its people will always be protected&amp;rdquo;.&lt;/p&gt;\r\n\r\n&lt;p&gt;Thank you,&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Prime Minister Dr. Mustafa Madbouly&lt;/strong&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n"
/// brief_E : "<div style=\"text-align:justify\">\r\n<p>&ldquo;The government has been honored to submit its program of action to the House of Representatives in July 2018. The government has continued to persistently implement this program with all its axes, which were included in the government&#39;s presidential assignment letter issued in June 2018. Despite the Corona virus outbreak and its extended impact on various countries of the world and on numerous Egyptian plans, the Egyptian government has been keen to quickly and effectively contain it and support the groups and sectors most affected by the repercussions of the pandemic.</p>\r\n\r\n<p>It is worth noting that the adopted, and well-planned governmental policies, especially the economic reform program applied since late 2016, have contributed to achieving a real and effective way to overcome Egypt&#39;s effects and repercussions of the crisis with the least possible losses. This has been evident in increasing financial capacity in light of the good performance of the State&#39;s General Budget, and maintaining a positive growth rate along with few countries in the world.</p>\r\n\r\n<p>Through its program of action, the government has been keen on giving the health sector great attention and arduous efforts; and to create a clear vision for the development and strengthening of this vital sector, which has reflected positively on the cohesion of the Egyptian health system in the face of the crisis. The government has been providing various vaccines to overcome this crisis with the inevitability of local manufacturing to secure a large stock of these vaccines for citizens in the light of the limited global production, in a way that paves the way to achieving self-sufficiency and to export accordingly.</p>\r\n\r\n<p>Complementing the successfully implemented economic program, the government has launched in April 2021 the National Program for Structural Reforms without placing any new burdens on the Egyptian citizen, with the aim of transforming the Egyptian economy into a productive one with competitive advantages while improving the business environment, enhancing the role of the private sector, and raising the efficiency of public institutions. This can be achieved by adopting digital transformation and governance policies to achieve balanced and sustainable growth in the coming years in cooperation with all actors. It&rsquo;s worth mentioning that many international institutions have praised the good indicators achieved by the Egyptian economic reform program.</p>\r\n\r\n<p>Considering the commitment of the government to inform the Egyptian people and their deputies of the progress achieved in its work program, I am honored to put before you the comprehensive follow-up report of the government&#39;s work program during the past three years (July 2018- June 2021), including the most prominent efforts of the government in confronting the Corona virus, hoping that Egypt and its people will always be protected&rdquo;.</p>\r\n\r\n<p>Thank you,</p>\r\n\r\n<p><strong>Prime Minister Dr. Mustafa Madbouly</strong></p>\r\n</div>\r\n"
